import React from 'react'
import Revenue from './Card_assets/Icons_1.png'

const Vcard = (codes) => {
    console.log(codes.num)
  return (
    <div>
        <img src={Revenue} alt="revenue"></img>
        <span>{codes.num}</span>
        <span>{codes.text}</span>
    </div>
  )
}

export default Vcard
